import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/pagination';

import { Pagination } from 'swiper/modules';

const events = [
  {
    image: '/logo512.png',
    title: 'DECEPTACON',
    date: 'Feb 22, 1–5pm',
    description: 'An all-afternoon event highlighting the UW and Seattle fashion scenes...',
    logo: '/images/mesh-logo.png',
  }
  // Add more event objects here
];

export default function EventCarousel() {
  return (
    <div className="w-full px-8">
        <h3>Test</h3>
      <Swiper
        slidesPerView={1.5}
        centeredSlides={true}
        spaceBetween={20}
        pagination={{ clickable: true }}
        modules={[Pagination]}
        className="mySwiper"
      >
        {events.map((event, index) => (
          <SwiperSlide key={index}>
            <div className="bg-white rounded-2xl overflow-hidden shadow-lg">
              <img src={event.image} className="w-full h-60 object-cover rounded-t-2xl" />
              <div className="p-4 flex items-start gap-3">
                <img src={event.logo} className="w-12 h-12 rounded-full" alt="Logo" />
                <div>
                  <h3 className="text-xl font-bold">{event.title}</h3>
                  <p className="text-sm">{event.description}</p>
                </div>
                <div className="ml-auto text-sm font-semibold">{event.date}</div>
              </div>
            </div>
          </SwiperSlide>
        ))}
      </Swiper>
    </div>
  );
}
